  return (
    <div>
      <Navigation
        isAuthenticated={isAuthenticated}
        setIsAuthenticated={setIsAuthenticated}
        handleAuthentication={handleAuthentication}
      />

      <section className="container mx-auto px-4 py-20">
        <div className="grid lg:grid-cols-2 gap-12 items-start bg-green-50">
          <div className="flex flex-col items-start">
            <div className="inline-flex items-center gap-2 bg-blue-100 text-blue-700 px-4 py-2 rounded-full mb-6">
              <Sparkles className="h-4 w-4" />
              <span>AI-powered Medical Interview Practice</span>
            </div>
            <h1 className="mb-6">Master Your Medical Interviews with AI</h1>
            <p className="text-xl text-gray-600 mb-8 text-left">
              Practice realistic medical school and residency interviews with our advanced AI interviewer. 
              Get instant feedback, improve your responses, and boost your confidence.
            </p>
          </div>
        <div>
          hwllo!
        </div>
        </div>
      </section>
    </div>
  );
}
